import { Route, Routes } from "react-router-dom";
import "./App.css";
import { update } from "./BooksAPI";
import Home from "./components/Home";
import Search from "./components/Search";

function App() {
  return (
    <div className="app">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/search" element={<Search />} />
      </Routes>
    </div>
  );
}

export default App;
